import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Card(){
  console.log();
  return(
    <>
    <div className='cards'>
      <div className='card'>
        <img src='https://e1.pxfuel.com/desktop-wallpaper/803/686/desktop-wallpaper-mystic-dark-the-series-darkness-time-travel-netflix-dark-netflix-thumbnail.jpg' alt='myPic' className='card_img' />
        <div className='card_info'>
          <span className='card_category'>A Netflix original series</span>
          <h3 className='card_title'>Dark</h3>
          <a href='https://www.netflix.com/in/title/80100172' target='_blank'>
            <button>watch now</button>
          </a>
        </div>
      </div>
    </div>
  </>
  );
}

ReactDOM.render(
  <>
    <Card/>
    <Card/>
    <Card/>
  </>,
  document.getElementById("root")
);
